window.bookSummaryJSON = "<p>#1 <i>New York Times</i> bestselling author Nora Roberts enchants listeners with this time-traveling romance about one man torn between his own time and the woman he loves in the past. </p> <p>Stranded in the present, time traveler Caleb Hornblower's biggest problem isn't returning to the twenty-third century - but falling head over heels for the beguiling Liberty Stone, who shows him a love more powerful than time itself. Though Caleb knows he belongs in the future, how can he leave the past, and Liberty, behind?</p>"; 
